from gmpy2 import iroot, gcd, gcdext



diff = 2
while True:
    #p*p + p*d - n = 0
    # p = (-d + sqrt(d*d+4n))/2
    dics, perf_sq = iroot(diff**2 + 4*n,2)
    if perf_sq:
        p = (dics - diff)//2
        q = n//p
        break
    diff+=2
    
mp = pow(ct, (p+1)//4, p)
mq = pow(ct, (q+1)//4, q)
_,yp,yq = gcdext(p,q)
r1 = int((yp*p*mq + yq*q*mp)%n)
r2 = int((yp*p*mq - yq*q*mp)%n)
r3 = n-r1
r4 = n-r2
print(r1.to_bytes( (r1.bit_length()+7)//8,'big'))
